import React from 'react'; //Reactを読み込んでいる

//画面遷移で使用する{ BrowserRouter, Route, Switch }を'react-router-dom'から読み込んでいる
import { Routes ,Route ,useSearchParams } from "react-router-dom";
import Page1 from './components/Page1'; //作成したpage1.jsを読み込んでいる
import Page2 from './components/Page2'; //作成したpage1.jsを読み込んでいる
import Login from './components/Login'; //作成したpage1.jsを読み込んでいる


const Router = () => {

    
    return (
        <>
            <Routes>
                <Route path="/login" element={<Login />} /> //URLのパスが'/'のみの時にpage1を表示する
                <Route path="/signin" element={<Page1 />} /> //URLのパスが'/'のみの時にpage1を表示する
                <Route path="/2" element={<Page2 />} /> //URLのパスが'/'のみの時にpage1を表示する
            </Routes>
        </>
    );
}

export default Router;
